import { PayCardStyled } from "./styles";

interface PayCardProps {
  img: string;
  planName: string;
  anouncesQuantity: string;
  price: number;
}

const PayCard = ({ img, planName, anouncesQuantity, price }: PayCardProps) => {
  return;
  <PayCardStyled>
    PayCard
    <ul>
      <li>{img}</li>
      <li>{planName}</li>
      <li>{anouncesQuantity}</li>
      <li>{price}</li>
    </ul>
  </PayCardStyled>;
};

export default PayCard;
